import React from 'react';
import styles from './Navbar.module.css';


navbar = () => {
    <div className={styles.navbar}>
        <ul>
            <li><a>Users</a></li>
            <li><a>Posts</a></li>
            <li><a>Todo</a></li>
            <li><a>Products</a></li>
        </ul>
    </div>
}

export default navbar;
